// src/nodes/LLMNode.js
import React from "react";
import BaseNode from "./BaseNode";

export default function LLMNode({ id, data }) {
  const model = data?.model || "gpt-3.5";
  return (
    <BaseNode
      id={id}
      data={{
        title: "LLM",
        subtitle: model,
        inputs: [{ id: `${id}-prompt`, label: "prompt" }],
        outputs: [{ id: `${id}-response`, label: "response" }],
        children: <div>Large Language Model node.</div>,
      }}
    />
  );
}
